    [],nt"revision_timestamp": "2016-11-18T20:00:40.247956",nt"name": "environmental-assessment-of-wild-turkey",nt"isopen":
    false,nt"url": null,nt"notes": "This is an unpublished report on the environmental
    assessment and proposed restocking of Wild Turkey at Santee National Wildlife Refuge.
    Santee Refuge proposes, through a joint agreement with the South Carolina Wildlife
    Marine Resources Department, to release an undetermined number of wild turkey at
    points on the Cuddo and Pine Island Units . These birds will serve as a nucleus
    by which, it is hoped that restoration of the species to its former reuse can be
    achieved. All trapping, moving and release work will be done by state personnel
    and monitored by refuge staff personnel. The birds will be trapped from state game
    management areas in the state, and held for observation prior to release. Present
    thinking is that the species will not be hunted on the refuge but that any established
    populations will serve as a reservoir from which to obtain birds for stocking of
    other areas.",nt"license_title": "License Not Specified",nt"extras":
